    const options = {
      method: 'POST',
      headers : {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(contactPage)

    }
    fetch('/cabins', options)
      .then(response => response.json())
      .then(data => {
        console.log(data);
      })
  };

export default function PostCabin (props) {
    return(
        <>
            <p>Hello from PostCabin</p>
            <button onclick={newCabin()}>Post a cabin</button>
        </>
    )
}
